import React from "react";
import { cartContext } from "./../context/cartContext";

class CheckOut extends React.Component {
	static contextType = cartContext;

	render() {
		{
			this.context.cart.map((item) => {
				return <h1>Cart</h1>;
			});
		}
	}
}

export default CheckOut;
